  ctx.lineTo(x2 + width - radius, y2);
  ctx.arc(x2 + width - radius, y2 + radius, radius, -Math.PI / 2, 0);
  ctx.lineTo(x2 + width, y2 + height - radius);
  ctx.arc(x2 + width - radius, y2 + height - radius, radius, 0, Math.PI / 2);
  ctx.lineTo(x2 + radius, y2 + height);
  ctx.arc(x2 + radius, y2 + height - radius, radius, Math.PI / 2, Math.PI);
  ctx.lineTo(x2, y2 + radius);
  ctx.arc(x2 + radius, y2 + radius, radius, Math.PI, Math.PI * 3 / 2);
